Per Byhring is a Norwegian composer from Oslo.
He makes playful electronic music for day dreamers, closet hippies, 9to5ers, weekend dad's, tea drinkers and other nice people. Best enjoyed seated at your desk with a hot cuppa fluid of choice and a decent pair of headphones.
